import Link from "next/link";
import Layout from "../components/Layout";
import { Provider } from "react-redux";
import Store from "../redux/store";
const store = Store();

export default () => {
  <Provider store={store}></Provider>
  return (
    <Layout title="Home">
      <Link href="/subjects">
        <h1>Subject Wise</h1>
      </Link>

      <Link href="/years">
        <h1>Year Wise</h1>
      </Link>
    </Layout>
  );
};
